INSERT INTO `aura_consent_form` (`id`, `consent_type_id`, `content`, `created_at`, `updated_at`) VALUES
(1, 2, '<p>jjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjj</p>\r\n', '2018-03-10 01:40:54', '2018-03-10 02:00:55'),
(2, 1, '<p>GENERAL CONSENT FORM&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I, the undersigned, do hereby state and confirm as follows:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THIS IS A DIGITAL AGREEMENT HENCE SIGNATURE IS NOT REQUIRED. ?&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. I HAVE BEEN EXPLAINED THE FOLLOWING IN TERMS OF LANGUAGE THAT I UNDERSTAND. ?I HAVE BEEN EXPLAINED THE FOLLOWING IN (LANGUAGE) THAT IS SPOKEN AND UNDERSTOOD BY ME.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. THE TREATMENT THAT I RECEIVE WILL BE APPROPRIATE FOR MY CONDITION AND SPECIFIC NEEDS AND WILL BE GIVEN BY THE DOCTOR OR APPROPRIATELY TRAINED MEMBER OF THE CLINIC.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. FOLLOWING TREATMENT THE FOLLOWING CHANGES MAY OCCUR: REDNESS, BRUSHING, SWELLING, DARKEN SKIN, LIGHTER SKIN, BLISTERING, CRUISING AND MAY TAKE DAYS/MONTHS TO RESOLVE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. I HAVE BEEN INFORMED ABOUT THE POTENTIAL COMPLICATIONS OF THE PROCEDURE AND SHALL INFORM THE DOCTOR IMMEDIATELY ABOUT ANY CHANGE IN MY CONDITION.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. FOLLOW TREATMENT I SHOULD FOLLOW WRITTEN INSTRUCTIONS GIVEN TO ME AND I SHALL NOT PRICK, SCRATCH OR INJURE THE SKIN.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6.&nbsp;I ?SHALL&nbsp;PROTECT MY SKIN FROM SUNLIGHT USING SUN BLOCKS AND PHYSICAL MEASURES LIKE UMBRELLAS, CAPS AND CLOTHING.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. I UNDERSTAND THAT PHOTOGRAPHS WILL BE TAKEN BEFORE AND AFTER THE PROCEDURE AND SHALL BE THE PROPERTY OF CLINIC AND WILL BE USED FOR EDUCATIONAL PURPOSE ONLY.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>8. I UNDERSTAND THAT IT IS MY RESPONSIBILITY TO INFORM THE DOCTOR/NURSE ABOUT MY MEDICATION CONDITION, MEDICATIONS TAKEN AND ALLERGIES IF ANY.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>9. I UNDERSTAND THAT TIGHTENING AND RADIO FREQUENCY CAUTERY CANNOT BE DONE IN THOSE-PATIENT WHO&nbsp;HAVE&nbsp;METAL IMPLANTS AND PACEMAKER. ?IF YOU HAVE ANY IT IS YOUR RESPONSIBILITY TO INFORM&nbsp;YOUR ?DOCTOR.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>10. I HAVE BEEN TOLD THAT DURING PREGNANCY OR LACTATION (BREAST FEEDING) TREATMENT CANNOT BE DONE AND I CONFIRM THAT I AM NOT PREGNANT NOR I PLAN TO GET PREGNANT DURING THE COURSE OF TREATMENT.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>11. I DON&rsquo;T HAVE ANY HISTORY OF KELOIDS, PHOTO INDUCED DISORDER LIKE DLE, SLE, VITILIGO, PSORISIS, BLEEDING DISORDERS, IMPLANTS, CELLULITE, RENAL FAILURE, HERPES, IMMUNOCOMPROMISED.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>12. I HAVE BEEN PROVIDED WITH REQUISITE INFORMATION, I HAVE UNDERSTOOD; AND THEREAFTER I CONSENT, AUTHORIZE AND DIRECT THE DOCTOR IN CHARGE AND HIS/HER TEAM WITH ASSOCIATES OR ASSISTANTS OF HIS / HER CHOICE TO PERFORM THE PROPOSED TREATMENT MENTIONED HEREIN ABOVE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>13. I HAVE BEEN EXPLAINED AND HAVE UNDERSTOOD THAT DUE TO UNFORESEEN CIRCUMSTANCES DURING THE COURSE OF THE PROPOSED TREATMENT SOMETHING MORE OR DIFFERENT THAN WHAT HAS BEEN ORIGINALLY PLANNED AND FOR WHICH I AM GIVING THE CONSENT MAY HAVE TO BE PERFORMED OR ATTEMPTED. ?IN ALL SUCH EVENTUALITIES, I AUTHORIZE AND GIVE MY CONSENT TO THE MEDICAL TEAM TO PERFORM SUCH OTHER AND FURTHER ACTS THAT THEY MAY DEEM FIT AND PROPER USING THEIR PROFESSIONAL JUDGEMENT.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>14. I STATE THAT THE DOCTOR-IN-CHARGE HAS ANSWERED ALL MY QUESTIONS TO MY SATISFACTION REGARDING THE PROPOSED TREATMENT.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>15. I HAVE BEEN EXPLAINED AND HAVE UNDERSTOOD THAT DESPITE THE BEST EFFORTS THERE CAN BE NO ASSURANCE ABOUT THE RESULT OF THE PROPOSED TREATMENT. ?I FURTHER STATE AND CONFIRM THAT I HAVE NOT BEEN GIVEN ANY GUARANTEE OR WARRANTY ABOUT THE RESULTS OF THE PROPOSED TREATMENT AND ALSO AGREE THAT THE AMOUNT PAID TOWARDS THE TREATMENT IS NON REFUNDABLE AND NON-TRANSFERABLE TO ANY OTHER TREATMENTS.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>16. I HAVE BEEN EXPLAINED AND HAVE UNDERSTOOD THAT DESPITE ALL PRECAUTIONS&nbsp;COMPLICATIONS ?MAY&nbsp;OCCUR.?&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>17. I CONSENT TO MY PHOTOGRAPHS TO BE USED IN MEDICAL PUBLICATIONS PROVIDED THEY ARE ANONYMIZED.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>18. I STATE THAT AFTER EXPLAINING, COUNSELLING AND DISCLOSURES I HAVE BEEN GIVEN ENOUGH TIME TO TAKE DECISION FOR GIVING CONSENT.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>19. THESE TERMS AND CONDITIONS SHALL BE GOVERNED BY AND CONSTRUED AND ENFORCED IN ACCORDANCE WITH THE LAWS OF INDIA AND IN RESPECT OF ANY DISPUTE ARISING UPON, OVER OR IN RESPECT OF ANY OF THE TERMS AND CONDITIONS GIVEN HEREIN ABOVE, ONLY THE COURTS ?IN ?BARODA SHALL HAVE EXCLUSIVE JURISDICTION TO TRY AND ADJUDICATE SUCH DISPUTES.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>20. I HAVE SIGNED THIS CONSENT VOLUNTARILY OUT OF MY FREE WILL AND WITHOUT ANY KIND OF PRESSURE OR COERCION.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>21. I HEREBY CONFIRM THAT THE SERVICE UNDERTAKEN TODAY AT AURA HAS BEEN SATISFACTORY AND WAS AS PER THE PROCEDURE EXPLAINED TO ME.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>LASER HAIR REDUCTION&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>I, the undersigned, do hereby state and confirm as follows:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>THIS IS A DIGITAL AGREEMENT HENCE SIGNATURE IS NOT REQUIRED. ?I HAVE READ ALL THE POINTS MENTIONED IN THE CONSENT FORM. ?THE ?DERMATOLOGIST&nbsp;HAS RECOMMENDED THE FOLLOWING PROCEDURE TO BE PERFORMED.?&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>NAME OF THE PROCEDURE: LASER HAIR REDUCTION USING US FDA APPROVED LUMENIS LIGHT SHEER DIODE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. I HAVE BEEN EXPLAINED IN A LANGUAGE THAT I UNDERSTAND THE NATURE OF THE PROCEDURE. ?IT&rsquo;S EXPECTED ? ? BENEFITS, POSSIBLE SIDE AND AFTER EFFECTS AND THE RISK INVOLVED. ?I ?HAVE ALSO BEEN INFORMED OF THE ALTERNATE METHODS OF TREATMENT BENEFITS AVAILABLE AND THEIR RESPECTIVE BENEFITS, POSSIBLE SIDE AND AFTER EFFECTS AND RISK.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. I HAVE&nbsp;BEEN ?INFORMED&nbsp;THAT THE PROCEDURE(S) / COMPLICATIONS, EMERGENCIES OR ABNORMALITIES MAY ARISE, DEVELOP OR BE DISCOVERED AND THIS MAY REQUIRE DEVIATION FROM OR SUSPENSION OF THE PROPOSED PROCEDURE(S) AND IT MAY BE NECESSARY TO PERFORM DIFFERENT OR ADDITIONAL PROCEDURE(S).&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. I HAVE UNDERSTOOD THAT EXCESSIVE HAIR MAY BE DUE TO CERTAIN HORMONES, MEDICATION OR GENETIC PREDISPOSITION.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. SEVERAL&nbsp;TREATMENT&nbsp;MAY BE NECESSARY TO GET DESIRED / ADEQUATE RESULTS SINCE LASER EFFECTIVELY DESTROYS HAIR IN ACTIVE STAGE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. I UNDERSTAND THAT IT MAY NOT BE POSSIBLE TO ACHIEVE PERMANENT RESULTS WITH THIS TREATMENT. ? ? ? ??&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6. I HAVE BEEN INFORMED THAT&nbsp;THE ?RESULTS&nbsp;MAY VARY FROM PERSON TO PERSON.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. I AM AWARE THAT THE PROCEDURES MAY BE PERFORMED BY DERMATOLOGIST OR TRAINED STAFF AND MAY BE ASSISTED BY OTHER STAFF TO WHOM YOUR DERMATOLOGIST MAY ASSIGN DESIGNATED RESPONSIBILITIES.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>8. I HAVE BEEN TOLD THAT DURING PREGNANCY OR LACTATION LASER CANNOT BE DONE AND I CONFIRM THAT I AM NOT PREGNANT NOR I PLAN TO GET PREGNANT DURING THE COURSE OF LASER.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>9. I DON&rsquo;T HAVE ANY HISTORY OF KELOIDS, PHOTO INDUCED DISORDERS LIKE DLE, SLE, VITILIGO, PSORIASIS, BLEEDING, DISORDERS, IMPLANTS, CELLULITE, RENAL FAILURE, HERPES, IMMUNOCOMPROMISED.&nbsp;</p>\r\n\r\n<p>? ? ? ? ? ? ? ?&nbsp;</p>\r\n\r\n<p>10. I DON&rsquo;T HAVE ANY HISTORY OF ORAL ISOTRETINOIN IN PAST 3 MONTHS.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>11. I HAVE BEEN EXPLAINED THAT LASER IS NOT EFFECTIVE ON FINE, VELLUS, RESISTANT HAIR AND WHITE HAIR.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>12. TREATMENT CAN BE DELIVERED AT ANY TIME THE HAIR IS NOTED (IT IS ADVISED TO WAIT FOR MINIMUM PERIOD OF TIME BEFORE ANOTHER TREATMENT SESSION). ?I HAVE UNDERSTOOD THAT DURATION BETWEEN SESSIONS DEPENDS ON THE HAIR REGROWTH. ?IT REGROWS MORE QUICKLY IN AREAS WHICH TEND TO PRODUCE HAIR RAPIDLY (CHIN) THAN IN AREAS TYPICALLY ASSOCIATED WITH SLOWER HAIR GROWTH (BACK) PATIENTS USUALLY REPORT HAIR GROWTH IN SLOWER, FINER IN TEXTURE AND SPARSER AFTER EACH TREATMENT.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>13. IN MOST OF THE CASES LASER HAIR REMOVAL IS PAINLESS. ?IF REQUIRED A LOCAL ANESTHETIC CREAM WILL BE APPLIED.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>14. I UNDERSTAND THAT TREATMENT MAY INVOLVE RISK OF COMPLICATION OF INJURY FROM BOTH KNOWN AND UNKNOWN CAUSES AND I FREELY ASSUME&nbsp;THESE RISK. ?THESE&nbsp;RISK&nbsp;INCLUDE, BUT ARE NOT LIMITED TO THE FOLLOWING:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>SKIN IRRITATION, ITCHING, BURNS FROM LASER TREATMENT.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>TEMPORARY REDNESS IN TREATED AREA WHICH USUALLY LAST FOR FEW HOURS.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>SWELLING IN TREATED AREA WHICH USUALLY SUBSIDES IN 24 HOURS.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>PIGMENTARY (LIGHT OR DARK) i.e., POST INFLAMMATORY HYPER OR HYPO PIGMENTATION IN SKIN POST LASER THERAPY WHICH IS USUALLY TEMPORARY AND GETS REMOVED IN FEW DAYS / MONTHS.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>PAIN DURING THE PROCEDURE / STINGING OR BURNING SENSATION WHICH USUALLY SUBSIDES IN 24 HOURS.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>SUPERFICIAL SKIN INFECTION.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>FOLLICULITIS FROM INGROWING HAIR.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>ALLERGIC REACTION TO SOLUTION OR PRODUCT USE.&nbsp;</p>\r\n	</li>\r\n	<li>\r\n	<p>LONG HAIR: THIS PROCESS IS KNOWN TO HAPPEN WITH ALL KINDS OF HAIR REDUCTION TECHNOLOGIES. ?THE LASED HAIR IS PUSHED INTO A PROLONGED ANAGEN PHASE. ?I HAVE UNDERSTOOD THAT THIS CAN HAPPEN AND HAVE BEEN ADVISED TO USE SCISSORS TO CUT&nbsp;THESE LONG HAIR&nbsp;IN MAINTENANCE PHASE.&nbsp;</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>15. FOR ACADEMIC AND SCIENTIFIC PURPOSES, THE BEFORE AND AFTER PROCEDURE MAY BE PHOTOGRAPHED.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>16. I UNDERSTAND THAT MAINTENANCE SESSIONS ARE REQUIRED. ?THE GAP BETWEEN MAINTENANCE SESSIONS VARY FROM PERSON TO PERSON AND ARE NOT INCLUDED IN PACKAGE. ?CHARGES HAVE TO BE PAID SEPARATELY AT THAT TIME.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>17. I UNDERSTAND THAT AFTER FEW SESSIONS HAIR GROWTH BECOMES PATCHY. ?ONLY THESE PATCHY AREA WILL BE TREATED BY LASER AND THE REST NORMAL AREA WHERE THERE IS NO HAIR GROWTH WILL NOT BE TREATED TO AVOID ANY SIDE EFFECTS.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>18. ONCE TREATMENT PROCESS IS STARTED IT IS COST TO SET UP, ?THEREBY MONEY ONCE PAID WILL NOT BE REFUNDABLE AND NON TRANSFERABLE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>19. IT IS MY RESPONSIBILITY TO FOLLOW DOCTOR&rsquo;S INSTRUCTIONS.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>20. I CONSENT TO MY PHOTOGRAPHS TO BE USED IN MEDICAL PUBLICATIONS PROVIDED THEY ARE ANONYMIZED.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>21. I CERTIFY THAT I HAVE READ THE ENTIRE INFORMED CONSENT AND I UNDERSTAND&nbsp;AND ?AGREE&nbsp;TO THE INFORMATION PROVIDED ABOVE.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>22. THESE TERMS AND CONDITIONS SHALL BE GOVERNED BY AND CONSTRUED AND ENFORCED IN ACCORDANCE WITH THE LAWS OF INDIA AND IN RESPECT OF ANY DISPUTE ARISING UPON, OVER OR IN RESPECT OF ANY OF THE TERMS AND CONDITIONS GIVEN HEREIN ABOVE, ONLY THE COURTS ?IN ?BARODA SHALL HAVE EXCLUSIVE JURISDICTION TO TRY AND ADJUDICATE SUCH DISPUTES.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>23. I HEREBY CONFIRM THAT THE SERVICE UNDERTAKEN TODAY AT AURA HAS BEEN SATISFACTORY AND WAS AS PER THE PROCEDURE EXPLAINED TO ME.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>WITH ALL THE KNOWLEDGE ABOUT THE TREATMENT I AM READY TO UNDERGO THE TREATMENT.&nbsp;</p>\r\n\r\n<p>Cancel&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2018-03-10 01:42:45', '2018-03-10 02:30:30');
