INSERT INTO `aura_email_template` (`et_id`, `ett_id`, `content`, `created_at`, `updated_at`) VALUES
(1, 2, '<p>Good morning {{PATIENT}}</p>\r\n\r\n<p>Just to remind you about your appointment at Aura Laser and Cosmetic Clinic ({{CATEGORY}}).</p>\r\n\r\n<p>WHEN :&nbsp;&nbsp; &nbsp;{{DATE}} at {{TIME}}<br />\r\nWHERE :&nbsp;&nbsp; &nbsp;A/4, Bihari Apts, RC Dutt Road<br />\r\nAlkapuri<br />\r\nVadodara, Gujarat- 390007&nbsp;<br />\r\nGet Directions</p>\r\n\r\n<p>For any queries, contact us at : {{CLINICCONTACTNUMBER}}&nbsp;<br />\r\nYou can read more about Aura Laser and Cosmetic Clinic at www.auralaserclinic.com</p>\r\n', '2018-01-27 02:21:44', '2018-03-10 23:15:16'),
(2, 1, '<p>Dear {{PATIENT}},</p>\r\n\r\n<p>We hope you have been in the best of health after you visited us last time.&nbsp;</p>\r\n\r\n<p>This email is our sincere effort to remind you for a follow-up visit. Follow-up visits are a great way of ensuring continuity of care and maintaining your state of well being.&nbsp;</p>\r\n\r\n<p>You can book an appointment with us&nbsp;<br />\r\nOnline at: https://www.practo.com/aura-laser-and-cosmetic-clinic/appointment or&nbsp;<br />\r\nBy phone at: {{CLINICCONTACTNUMBER}}&nbsp;</p>\r\n\r\n<p>Wishing you good health always,&nbsp;<br />\r\nAura Laser and Cosmetic Clinic</p>\r\n', '2018-01-27 14:32:07', '2018-03-10 23:15:05'),
(3, 3, '<p>Dear {{PATIENT}},</p>\r\n\r\n<p>Wish you a very Happy Birthday!&nbsp;<br />\r\nIt&#39;s time to celebrate another trip you made around the sun!&nbsp;<br />\r\n<br />\r\nMay this special day mark the beginning of a healthier life filled with happiness and prosperity.<br />\r\n<br />\r\nCheers,</p>\r\n\r\n<p>{{DOCTOR}}</p>\r\n', '2018-03-10 23:12:38', '0000-00-00 00:00:00'),
(4, 4, '<p>Dear {{PATIENT}},</p>\r\n\r\n<p>On this special day, all of us at Aura Laser and Cosmetic Clinic wish you and your spouse many years of happiness and health.&nbsp;</p>\r\n\r\n<p>More than the pop of balloons, flash of lights and shower of confetti &ndash; may the sounds of laughter, flashes of smiles and showers of happiness mark your day.&nbsp;</p>\r\n\r\n<p>Happy Anniversary!&nbsp;</p>\r\n\r\n<p>Best wishes,</p>\r\n\r\n<p>{{DOCTOR}}</p>\r\n\r\n<p>Aura Laser and Cosmetic Clinic</p>\r\n\r\n<p>Phone: {{CLINICCONTACTNUMBER}}</p>\r\n', '2018-03-10 23:13:32', '0000-00-00 00:00:00');
